import {
  Container,
  Row,
  Col,
  Alert,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";
import Moment from "react-moment";
const { detect } = require("detect-browser");

let now = new Date();
let currentBrowser = null;

class SystemInfo extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      browser: ""
    };
  }
  componentDidMount() {
    if (process.browser) {
      this.setState({ browser: "" });
    }
  }

  render() {}
}

export default SystemInfo;
